%[text] # Series de Fourier
%%
%[text] ## Variable compleja
%[text] 1\.- Graficar una expontencial compleja $x\\left(t\\right)=A\\;e^{\\textrm{Bjt}} \\;${"editStyle":"visual"}y visualizarla en 3D
%[text] 2\.- Graficar una expontencial compleja $x\\left(t\\right)=A\\;e^{-\\textrm{Bjt}} \\;${"editStyle":"visual"}y visualizarla en 3D
%[text] Basado en las gráficas anteriores: ¿Qué es un *frecuencia negativa*?
%[text] ![](text:image:8638)




%[text] Probar a mano que:
%[text] ![](text:image:3f59)
%[text] ![](text:image:02e0)
%%
%[text] ## ¿Por qué $e^{\\textrm{jt}}${"editStyle":"visual"}?
%[text] ![](text:image:5a6b)
%[text] ![](text:image:3149)
%[text] 1\.- Escribir en código, término por término, esta suma.
%[text] 2\.- Graficar el resultado en 3D
syms t
x = (1/3)*exp(-1i*-3*2*pi*t)+ ... %[output:group:92115c41] %[output:2a59ffbe]
    (1/2)*exp(-1i*-2*2*pi*t)+ ... %[output:2a59ffbe]
    (1/4)*exp(-1i*-1*2*pi*t)+ ... %[output:2a59ffbe]
    1+ ... %[output:2a59ffbe]
    (1/4)*exp(-1i*1*2*pi*t)+ ... %[output:2a59ffbe]
    (1/2)*exp(-1i*2*2*pi*t)+ ... %[output:2a59ffbe]
    (1/3)*exp(-1i*3*2*pi*t) %[output:group:92115c41] %[output:2a59ffbe]


figure %[output:18174eb7]
fplot3(real(x),t,imag(x)) %[output:18174eb7]
xlabel("Re") %[output:18174eb7]
ylabel("t") %[output:18174eb7]
zlabel("Im") %[output:18174eb7]


x_2 = (1/4)*exp(-1i*-1*2*pi*t) %[output:61c20e52]
x_3 = (1/4)*exp(-1i*1*2*pi*t) %[output:4ceef74f]

figure %[output:1b3334ee]
fplot3(real(x_2),t,imag(x_2)) %[output:1b3334ee]
hold on %[output:1b3334ee]
fplot3(real(x_3),t,imag(x_3)) %[output:1b3334ee]
xlabel("Re") %[output:1b3334ee]
ylabel("t") %[output:1b3334ee]
zlabel("Im") %[output:1b3334ee]
%%
%[text] ## Series en forma compleja
%[text] ![](text:image:9ebe)
%[text] 1\.- Graficar la señal original 
%[text] 2\.- Calcular (con un for) los +/- 5 coeficientes y reconstruir la señal
%[text] 3\.- Calcular (con un for) los +/- 10 coeficientes y reconstruir la señal
%[text] (Opcional) Graficar los coeficientes
clear
syms t

x = exp(-t) %[output:6186d80d]
T_intervalo = [0 3];

figure %[output:567e4095]
fplot(x,T_intervalo) %[output:567e4095]
a_k = [];
e_k = [t];

%Un componente
T = 3;
%k = 5

for k = -10:10
    a_k(end+1) = (1/T)*int(x*exp(-1i*k*(2*pi/T)*t),t,T_intervalo);
    e_k(end+1) = exp(1i*k*(2*pi/T)*t);
end

e_k = e_k(2:end);

x_k = sum(a_k.*e_k);

fplot3(real(x_k),t,imag(x_k)) %[output:77dad5de]
xlabel("Re") %[output:77dad5de]
ylabel("t") %[output:77dad5de]
zlabel("Im") %[output:77dad5de]

%a_5 = (1/T)*int(x*exp(-1i*k*(2*pi/T)*t),t,T_intervalo)
%%
%[text] ## coeficientes
figure %[output:92f97b0b]
stem(abs(a_k)) %[output:92f97b0b]
figure %[output:01cac329]
stem(angle(a_k)) %[output:01cac329]
